import { PrismaClient } from '@prisma/client';
const prisma = new PrismaClient()
async function main() {
  const classesToInsert = [
    '4º ano - Técnico em Informática',
    '3º ano - Técnico em Informática',
    '2º ano - Técnico em Informática',
    '1º ano - Técnico em Informática',
    '4º ano - Técnico em Química',
    '3º ano - Técnico em Química',
    '2º ano - Técnico em Química',
    '1º ano - Técnico em Química',
    '4º ano - Técnico em Meio Ambiente',
    '3º ano - Técnico em Meio Ambiente',
    '2º ano - Técnico em Meio Ambiente',
    '1º ano - Técnico em Meio Ambiente',
    '1º ano - Técnico em Administração',
  ];

  const userPreferences = [
    ['Esporte', 'data:image/png;base64,'],
    ['Programação', 'data:image/png;base64,'],
    ['Academia', 'data:image/png;base64,'],
    ['Química Orgânica', 'data:image/png;base64,'],
    ['Leis Ambientais', 'data:image/png;base64,'],
    ['Sushi', 'data:image/png;base64,'],
    ['Literatura', 'data:image/png;base64,'],
    ['Música', 'data:image/png;base64,'],
    ['Stand up Comedy', 'data:image/png;base64,'],
    ['Pagode', 'data:image/png;base64,'],
    ['Balada', 'data:image/png;base64,'],
    ['Comida de Rua', 'data:image/png;base64,'],
    ['Carros', 'data:image/png;base64,'],
    ['Futebol Americano', 'data:image/png;base64,'],
    ['Sertanejo', 'data:image/png;base64,'],
    ['E-Sports', 'data:image/png;base64,']
  ]

  for (let i = 0; i < classesToInsert.length; i++) {
    const className = classesToInsert[i];
    await prisma.classes.upsert({
      where: { id: i + 1 },
      update: {},
      create: {
        className: className,
      },
    });
  }

  for (let i = 0; i < userPreferences.length; i++) {
    const userPreference = userPreferences[i];
    await prisma.preferences.upsert({
      where: { id: i + 1 },
      update: {},
      create: {
        icon: userPreference[1],
        title: userPreference[0]
      },
    });
  }

}

main()
  .then(async () => {
    await prisma.$disconnect()
  })
  .catch(async (e) => {
    console.error(e)
    await prisma.$disconnect()
    process.exit(1)
  })